import React from 'react'
import CardUser from '../../molecules/CardUser'

const UserList = ({ data }) => {
  return (
    <div className="mb-12">
      {(data || []).map((dataUser) => (
        <div
          key={dataUser.id.value}
          className="max-w-6xl mx-auto px-4 sm:px-6 lg:px-4 py-12 flex"
        >
          <CardUser />
        </div>
      ))}
    </div>
  )
}

export default UserList
